export const delay = (ms: number) => {
    return new Promise((resolve) => setTimeout(resolve, ms));
};

 export const countFibonacci = (n:number):number[] => {
    let arr: number[] = [0, 1];
    for (let i = 2; i < n + 1; i++) {
      arr.push(arr[i - 2] + arr[i - 1]);
    }
    return arr;
  }
